import React from 'react';
import '../'

const CreatePage = () => {
   return (
      <div class="create">
          <div class="create__container _container">
            <div class="create__type">new type</div>
            <div class="create__brand">new brand</div>
            <div class="create__cartitem">new card</div>
          </div>
        </div>
   );
};

export default CreatePage;
